  false,\n\t\"url\": null,\n\t\"notes\": \"Chemical, temperature, pressure, and salinity
  data were collected using bottle and CTD casts from the R/V Thomas G. Thompson in
  the Arabian Sea. Data were collected from July 17, 1995 to September 15, 1995. Data
  were collected by four different institution; Old Dominion University, Bermuda Biological
  Station for Research, Virginia Institute of Marine Science, and Woods Hole Oceanographic
  Institution as part of the Joint Global Ocean Flux Study / Arabian Sea Process Studies
  (JGOFS/Arabian) project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
